import React from 'react';

export default function TableDataRow({user}) {
    const setPermission = () => {
        if (user.permission === "1") { return <button className="btn btn-info">Admin</button> }
        else if (user.permission === "2") { return <button className="btn btn-info">User</button> }
    }
    return (
        <tr>
            <td >{user.STT}</td>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>
                {setPermission}
            </td>
            <td>{user.created}</td>
            <td>{user.updated}</td>
        </tr>
    );
}
